  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The SWAN Repository is the biospecimen
  bank of the SWAN study. All stored specimens are from the 3,302 SWAN participants,
  collected across the 14 clinic visits (Baseline and 13 follow-up visits). Available
  biospecimen types include serum, plasma, urine and DNA which total nearly 1.8 million.
  Both Repository specimens and data generated through Repository studies and subsequently
  returned are available through the SWAN Repository. Through the Repository website,
  registered users can submit inquiries and applications for access to these resources.</p>n\",\n\t\"license_title\":
